import React from 'react';
import Banner from './Banner'
import CoinTable from './CoinTable';

export const Home2 = ({curr,symbol}) => {
  return (
    <>
    <Banner currency = {curr}/>
    <CoinTable currency = {curr}/>
    </>
  )
}

 export default Home2;
